class LongestSubstringKDistinct
  def longSubstrKDistinct(str, k)
    return 0 if k == 0
    distinctChars = Hash.new
    substrlen = 0
    maxlen = 0
    start = 0
    len = (str.length) - 1
    for index in 0..len do
      char = str[index]
      if distinctChars.length < k || !distinctChars["#{char}"].nil?
        if !(distinctChars.keys[distinctChars.length-1] == "#{char}")
          distinctChars.delete("#{char}")
          distinctChars["#{char}"] = index
        end
      # p "distinctChars : #{distinctChars}"
      substrlen += 1
      else
        distinctChars.delete(distinctChars.keys[0])
        distinctChars["#{char}"] = index
        #  p "distinctChars : #{distinctChars}"
        start = distinctChars.values[0]
        substrlen = (index - start)+1
      end 
      #  p "substring length is #{substrlen}"
      maxlen = substrlen if maxlen < substrlen
      # break if maxlen > (len - start)
    end
    p "The length of the string is #{str.length}"
    p "The longest substring length with at most #{k} distinct characters the given string is \'#{maxlen}\'"
    return maxlen
  end
end

